.command {
  height: 100%;
  position: relative;
  min-height: 678px;
  background: #38394b;
  background-image: url(../../assets/yingzhi/command.jpg);
  background-repeat: no-repeat;
  background-size: 100% auto;
  .com_btn {
    position: absolute;
    z-index: 88;
    cursor: pointer;
  }
  .act_go {
    animation: act_go 0.5s;
    animation-fill-mode: forwards;
  }
  @keyframes act_go {
    0% {
      opacity: 0;
      -webkit-transform: scale(0);
    }
    50% {
      opacity: 1;
      -webkit-transform: scale(1.2);
    }
    100% {
      opacity: 1;
      -webkit-transform: scale(1);
    }
  }
  .gochang {
    animation: gochang 0.6s 0.3s;
    animation-fill-mode: forwards;
  }
  @keyframes gochang {
    0% {
      opacity: 0;
      transform: scaleX(0);
      transform-origin: left;
    }
    100% {
      opacity: 1;
      transform-origin: left;
      transform: scaleX(1);
    }
  }
  .goshow {
    animation: goshow 0.4s 0.5s;
    animation-fill-mode: forwards;
  }
  @keyframes goshow {
    0% {
      opacity: 0;
      transform: translateX(-10%) scale(0);
      transform-origin: left;
    }
    100% {
      opacity: 1;
      transform-origin: left;
      transform: translateX(0) scale(1);
    }
  }
  .box {
    position: relative;
    top: 0;
    left: 0;
    min-width: 100%;
    height: 100%;
    width: 100%;
    .shipin_rou {
      left: 7vw;
      top: 34.5vh;
    }
    .scenicMap_rou {
      left: 45vw;
      top: 34.5vh;
    }
    .carControl_rou {
      left: 60.5vw;
      top: 34.5vh;
    }
    .guide_rou {
      left: 70vw;
      top: 34.5vh;
    }
    .equipment_rou {
      left: 22vw;
      top: 34.5vh;
    }
    .diaodu_rou {
      left: 30vw;
      top: 34.5vh;
    }
    .bigdata_rou {
      right: 6vw;
      top: 34.5vh;
    }
    .ani_box {
      position: absolute;
      color: #ffffff;
      min-width: 2vw;
      height: 22vh;
      display: flex;
      justify-content: center;
      align-items: center;
      cursor: pointer;
      .bigcircle {
        /*position: absolute;*/
        background: #ffffff;
        border: 1px solid rgba(0, 0, 0, 0.7);
        border-radius: 50%;
        width: 1vw;
        height: 1vw;
        margin-left: 50px;
        opacity: 0;
        box-shadow: 0 0 14px 1px rgba(255, 255, 255, 0.5);
      }
      .goline {
        width: 2vw;
        height: 1px;
        background: rgba(255, 255, 255, 0.8);
        left: 0.5vw;
        top: 1vh;
        opacity: 0;
      }
      .notebox {
        left: 1vw;
        padding: 5px 10px;
        border-radius: 50px;
        background: #666666;
        border: 1px solid #ffffff;
        opacity: 0;
      }
    }
    img {
      width: 100%;
